import React, {useContext, useEffect, useState} from 'react';
import {Badge, ListGroup, Button} from "react-bootstrap";
import {Context} from "../index";

const OrderItem = ({orderCur}) => {


    return (
        <div className="order-item">
            <div >{orderCur.client_name}</div>
            <div >{orderCur.city}</div>
            <div >{orderCur.date_to_send}</div>
            <div >{orderCur.status}</div>
            <div >{orderCur.payment_status}</div>
            <div ></div>
            <div ></div>
        </div>
    );
};

export default OrderItem;
